u043c \"\u0442\u043e\u0447\u043a\u0430 Q\"&nbsp; \u0434\u043e\u0431\u0430\u0432\u0438\u0442\u044c \"\u0442\u043e \u0435\u0441\u0442\u044c \u0446\u0435\u043d\u0442\u0440 \u043e\u043a\u0440\u0443\u0436\u043d\u043e\u0441\u0442\u0438\". \u041f\u043e\u0442\u043e\u043c \u043f\u043e\u044f\u0441\u043d\u0438\u0442\u044c \u043a\u0440\u0430\u0442\u043a\u043e, \u043f\u043e\u0447\u0435\u043c\u0443 b \u0432 \u0443\u0440\u0430\u0432\u043d\u0435\u043d\u0438\u0438 \u0438 b \u0432 \u043a\u043e\u043e\u0440\u0434\u0438\u043d\u0430\u0442\u0430\u0445 \u0442\u043e\u0447\u043a\u0438 Q - \u043e\u0434\u043d\u043e \u0438 \u0442\u043e \u0436\u0435 b.\r\n\r\n\u0434\u0440\u0443\u0433\u0438\u0445 \u0437\u0430\u043c\u0435\u0447\u0430\u043d\u0438\u0439 \u043d\u0435\u0442.\r\n<br\/>\u0411\u0430\u043b\u0434\u0430\u0448\u0438\u043d\u043e\u0432\u0430 \u0412\u0430\u043b\u0435\u043d\u0442\u0438\u043d\u0430 (\u043a\u043e\u0440\u0440\u0435\u043a\u0442\u043e\u0440):\r\n<br\/>\u0417\u0430\u043c\u0435\u0447\u0430\u043d\u0438\u0439 \u043d\u0435\u0442.\r\n<br\/>\u0421\u043e\u043a\u043e\u043b\u043e\u0432\u0430 \u0420\u0435\u0433\u0438\u043d\u0430 (\u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0439 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0430):\r\n<br\/>\u0422\u0438\u0442\u0440\u044b \u0437\u0430\u043c\u0435\u043d\u0438\u0442\u044c \u043d\u0430 \u043d\u043e\u0432\u044b\u0435 \u0430\u043d\u0438\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0435.\r\n\u041f\u0435\u0440\u0435\u0441\u0432\u0435\u0442 \u043d\u0430 \u0440\u0443\u0431\u0430\u0448\u043a\u0435.\r\n32:15, 33:48 - \u043d\u0435\u0437\u043d\u0430\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u0442\u0440\u044f\u0441\u0435\u0442\u0441\u044f \u0434\u043e\u0441\u043a\u0430;\r\n35:32 - \u043d\u0430 \u0432\u0440\u0435\u043c\u044f \u0443\u0432\u0435\u0441\u0442\u0438 \u043b\u043e\u0433\u043e\u0442\u0438\u043f;\r\n39:13, 41:51 - \u0447\u0435\u0440\u0442\u0435\u0436\u0438 \u0431\u0443\u0434\u0443\u0442?\r\n\u041e\u0442\u0432\u0435\u0442\u0432\u043b\u0435\u043d\u0438\u0439 \u043d\u0435\u0442 - \u043f\u043e \u0441\u0446\u0435\u043d\u0430\u0440\u0438\u044e.\r\n<br\/>\u0410\u043b\u0438\u0441\u0435\u0435\u0432\u0430 \u041e\u043b\u044c\u0433\u0430 (\u043f\u043e\u043c\u043e\u0449\u043d\u0438\u043a \u043a\u0443\u0440\u0430\u0442\u043e\u0440\u0430):\r\n<br\/>\u0434\u0430 \u043c\u043d\u0435 \u0442\u043e\u0436\u0435 \u043a\u0430\u0436\u0435\u0442\u0441\u044f \u0447\u0442\u043e \u0441 03:30 \u043f\u043e 07:51 \u0432\u0441\u0435 \u044d\u0442\u043e \u043d\u0430\u043f\u043e\u043c\u0438\u043d\u0430\u043d\u0438\u0435 \u043c\u043e\u0436\u043d\u043e \u0441\u043c\u0435\u043b\u043e \u0432\u044b\u0440\u0435\u0437\u0430\u0442\u044c \u0438 \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0442\u0443\u0434\u0430 \u0438\u043d\u0444\u043e\u043a\u043d\u043e\u043f\u043a\u0443 \u0441 \u0441\u0441\u044b\u043b\u043a\u043e\u0439 \u043d\u0430 \u0443\u0440\u043e\u043a \u043c\u0435\u0442\u043e\u0434 \u0432\u044b\u0434\u0435\u043b\u0435\u043d\u0438\u044f \u043f\u043e\u043b\u043d\u043e\u0433\u043e \u043a\u0432\u0430\u0434\u0440\u0430\u0442\u0430 &nbsp; &nbsp; \u0437\u0430\u0434\u0430\u0447\u0438 \u043d\u0430 \u043f\u043e\u043b\u043d\u044b\u0439 \u043a\u0432\u0430\u0434\u0440\u0430\u0442 \u0441 10:01 \u043f\u043e &nbsp;21:05 &nbsp;\u044f \u0431\u044b \u0432\u044b\u043d\u0435\u0441\u043b\u0430 \u0432 \u043e\u0442\u0432\u0435\u0442\u0432\u043b\u0435\u043d\u0438\u0435 \u0441 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435\u043c \"\u0415\u0449\u0435 \u0437\u0430\u0434\u0430\u0447\u0438 \u0441 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u043c\u0435\u0442\u043e\u0434\u0430 \u0432\u044b\u0434\u0435\u043b\u0435\u043d\u0438\u044f \u043f\u043e\u043b\u043d\u043e\u0433\u043e \u043a\u0432\u0430\u0434\u0440\u0430\u0442\u0430\" &nbsp; &nbsp; &nbsp;\u0438 \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e \u0434\u0432\u0435 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0435 \u0437\u0430\u0434\u0430\u0447\u0438 \u0432 \u0443\u0440\u043e\u043a\u0435 \u0441 39:04 \u043f\u043e 44:10 &nbsp;\u044f \u0431\u044b \u0432\u044b\u043d\u0435\u0441\u043b\u0430 \u0432 \u043e\u0442\u0432\u0435\u0442\u0432\u043b\u0435\u043d\u0438\u0435 \u0441 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435\u043c \u0422\u0438\u043f\u043e\u0432\u044b\u0435 \u0437\u0430\u0434\u0430\u0447\u0438 \u043d\u0430 \u043d\u0430\u0445\u043e\u0436\u0434\u0435\u043d\u0438\u0435 \u043a\u043e\u043e\u0440\u0434\u0438\u043d\u0430\u0442 \u0442\u043e\u0447\u0435\u043a \u043d\u0430 \u043e\u043a\u0440\u0443\u0436\u043d\u043e\u0441\u0442\u0438\r\n<br\/>\u0410\u043b\u0438\u0441\u0435\u0435\u0432\u0430 \u041e\u043b\u044c\u0433\u0430 (\u043f\u043e\u043c\u043e\u0449\u043d\u0438\u043a \u043a\u0443\u0440\u0430\u0442\u043e\u0440\u0430):\r\n<br\/><p style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 12px; font-weight: bold; line-height: 14.039999961853027px; border-bottom-style: none !important;\">31:04 \u043a \u0441\u043b\u043e\u0432\u0430\u043c \u00ab\u0442\u043e\u0447\u043a\u0430 Q\u00bb&nbsp; \u0434\u043e\u0431\u0430\u0432\u0438\u0442\u044c \u00ab\u0442\u043e \u0435\u0441\u0442\u044c \u0446\u0435\u043d\u0442\u0440 \u043e\u043a\u0440\u0443\u0436\u043d\u043e\u0441\u0442\u0438\u00bb. \u041f\u043e\u0442\u043e\u043c \u043f\u043e\u044f\u0441\u043d\u0438\u0442\u044c \u043a\u0440\u0430\u0442\u043a\u043e, \u043f\u043e\u0447\u0435\u043c\u0443 b \u0432 \u0443\u0440\u0430\u0432\u043d\u0435\u043d\u0438\u0438 \u0438 b \u0432 \u043a\u043e\u043e\u0440\u0434\u0438\u043d\u0430\u0442\u0430\u0445 \u0442\u043e\u0447\u043a\u0438 Q \u2013 \u043e\u0434\u043d\u043e \u0438 \u0442\u043e \u0436\u0435 b.<\/p><p style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 12px; font-weight: bold; line-height: 14.039999961853027px; border-bottom-style: none !important;\">\u0434\u0440\u0443\u0433\u0438\u0445 \u0437\u0430\u043c\u0435\u0447\u0430\u043d\u0438\u0439 \u043d\u0435\u0442.      \r\n\u042d\u0442\u043e \u0437\u0430\u043c\u0435\u0447\u0430\u043d\u0438\u0435 \u043c\u043d\u0435 \u043a\u0430\u0436\u0435\u0442\u0441\u044f \u043b\u0438\u0448\u043d\u0435\u0435, \u0434\u043e\u0441\u0442\u0430\u0442\u043e\u0447\u043d\u043e \u0432 \u0441\u0430\u043c\u043e\u043c \u043d\u0430\u0447\u0430\u043b\u0435 \u0437\u0430\u0434\u0430\u043d\u0438\u044f \u0443\u0441\u043b\u043e\u0432\u0438\u044f \u043d\u0430 30:24 \u0434\u043e\u0431\u0430\u0432\u0438\u0442\u044c \u043f\u043e\u0441\u043b\u0435 \u0441\u043b\u043e\u0432 \"\u0438 \u043e\u0434\u043d\u0430 \u0438\u0437 \u043a\u043e\u043e\u0440\u0434\u0438\u043d\u0430\u0442 \u0442\u0440\u0435\u0442\u044c\u0435\u0439 \u0442\u043e\u0447\u043a\u0438 \" - \"\u044f\u0432\u043b\u044f\u044e\u0449\u0435\u0439\u0441\u044f \u0446\u0435\u043d\u0442\u0440\u043e\u043c \u043e\u043a\u0440\u0443\u0436\u043d\u043e\u0441\u0442\u0438\" \u0438\u043b\u0438 \u043f\u0440\u043e\u0441\u0442\u043e \"\u0446\u0435\u043d\u0442\u0440\u0430 \u043e\u043a\u0440\u0443\u0436\u043d\u043e\u0441\u0442\u0438\" &nbsp; &nbsp; \u0432\u043e\u0442 \u044d\u0442\u043e\u0442 \u043c\u043e\u043c\u0435\u043d\u0442 \u0431\u0435\u0437 \u043f\u0435\u0440\u0432\u043e\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0447\u0435\u0440\u0442\u0435\u0436\u0430 \u043f\u043e\u043b\u0443\u0447\u0430\u0435\u0442\u0441\u044f \u0441\u043c\u0430\u0437\u0430\u043d\u043d\u044b\u043c \u0438 \u043d\u0435\u043f\u043e\u043d\u044f\u0442\u043d\u044b\u043c &nbsp;\u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e \u0432\u043c\u0435\u0441\u0442\u043e \u043b\u0438\u0446\u0430 \u0442\u0430\u0440\u0430\u0441\u043e\u0432\u0430 \u0441\u0434\u0435\u043b\u0430\u0442\u044c \u0432 \u044d\u0442\u043e\u0442 \u043c\u043e\u043c\u0435\u043d\u0442 \u0441\u043b\u0430\u0439\u0434 \u0441 \u0443\u0441\u043b\u043e\u0432\u0438\u0435\u043c \u0437\u0430\u0434\u0430\u0447\u0438 \u0438 \u0447\u0435\u0440\u0442\u0435\u0436\u043e\u043c&nbsp;<\/p>\r\n<br\/>\u0413\u0440\u0435\u0431\u0435\u043d\u044e\u043a \u042e\u0440\u0438\u0439 (\u0443\u0447\u0438\u0442\u0435\u043b\u044c):\r\n<br\/>\u0421\u043e\u0433\u043b\u0430\u0441\u0435\u043d \u0441 \u041e\u043b\u044c\u0433\u043e\u0439 - \u044f \u0431\u044b \u043d\u0430 30:24 \u0441\u0434\u0435\u043b\u0430\u043b \u0430\u0443\u0434\u0438\u043e\u0437\u0430\u043f\u043b\u0430\u0442\u043a\u0443 - \u0432\u043c\u0435\u0441\u0442\u043e \"\u0442\u0440\u0435\u0442\u044c\u0435\u0439 \u0442\u043e\u0447\u043a\u0438\" - \"\u0446\u0435\u043d\u0442\u0440\u0430 \u043e\u043a\u0440\u0443\u0436\u043d\u043e\u0441\u0442\u0438\". \u042d\u0442\u043e\u0433\u043e \u0434\u043e\u0441\u0442\u0430\u0442\u043e\u0447\u043d\u043e \u0434\u043b\u044f \u043f\u043e\u043d\u0438\u043c\u0430\u043d\u0438\u044f \u0441\u0443\u0442\u0438 \u0440\u0435\u0448\u0435\u043d\u0438\u044f, \u0442\u0435\u043c \u0431\u043e\u043b\u0435\u0435 \u043d\u0430 \u0434\u043e\u0441\u043a\u0435 \u043f\u043e\u0442\u043e\u043c \u0432\u043f\u0438\u0441\u0430\u043d\u043e \u0443\u0440\u0430\u0432\u043d\u0435\u043d\u0438\u0435 \u043e\u043a\u0440\u0443\u0436\u043d\u043e\u0441\u0442\u0438 \u0438 \u0443\u0447\u0438\u0442\u0435\u043b\u044c \u0434\u0435\u043b\u0430\u0435\u0442 \u0430\u043a\u0446\u0435\u043d\u0442 \u043d\u0430 \u0442\u043e\u043c, \u0447\u0442\u043e a=0, b - \u0438\u0437 \u0442\u043e\u0433\u043e \u0436\u0435 \u0443\u0440\u0430\u0432\u043d\u0435\u043d\u0438\u044f, \u0442\u043e \u0435\u0441\u0442\u044c, \u043a\u043e\u043e\u0440\u0434\u0438\u043d\u0430\u0442\u0430 \u0446\u0435\u043d\u0442\u0440\u0430.\r\n<br\/>\u0410\u043b\u0438\u0441\u0435\u0435\u0432\u0430 \u041e\u043b\u044c\u0433\u0430 (\u043f\u043e\u043c\u043e\u0449\u043d\u0438\u043a \u043a\u0443\u0440\u0430\u0442\u043e\u0440\u0430):\r\n<br\/>\u0438\u0442\u0430\u043a \u043f\u043e\u0434\u044b\u0442\u043e\u0436\u0443 \u043f\u043e \u043f\u0440\u0430\u0432\u043a\u0430\u043c:<div>1. &nbsp;\u043d\u0430 30:24 \u0432\u044b\u0440\u0435\u0437\u0430\u0442\u044c