3b\u044c\u0433\u0430 (\u043f\u043e\u043c\u043e\u0449\u043d\u0438\u043a \u043a\u0443\u0440\u0430\u0442\u043e\u0440\u0430):\r\n<br\/>\u0432 4 \u043f\u0443\u043d\u043a\u0442\u0435 \u043c\u043e\u043d\u0442\u0430\u0436\u0435\u0440\u0430\u043c \u0437\u0430\u043c\u0435\u043d\u0438\u0442\u044c \u0443\u0447\u0438\u0442\u0435\u043b\u044f \u043a\u0430\u0434\u0440\u0430\u043c\u0438 \u0441 \u043f\u043b\u0430\u043d\u0448\u0435\u0442\u0430\r\n<br\/>\u041a\u0440\u0430\u0441\u0438\u043b\u044c\u043d\u0438\u043a\u043e\u0432 \u0412\u043b\u0430\u0434\u0438\u0441\u043b\u0430\u0432 (\u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u043e\u0442\u0434\u0435\u043b\u0430 \u043c\u043e\u043d\u0442\u0430\u0436\u0430):\r\n<br\/><strong>\u0418\u0441\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u044b\u0439 \u0432\u0430\u0440\u0438\u0430\u043d\u0442 \u0431\u0435\u0437 \u0433\u0440\u0430\u0444\u0438\u043a\u0438 tarasov_26052014_uravnenie_okruzjnosti_ver2.flv<\/strong>\r\n<br\/>\u0410\u043b\u0438\u0441\u0435\u0435\u0432\u0430 \u041e\u043b\u044c\u0433\u0430 (\u043f\u043e\u043c\u043e\u0449\u043d\u0438\u043a \u043a\u0443\u0440\u0430\u0442\u043e\u0440\u0430):\r\n<br\/>\u0432\u0441\u0442\u0430\u0432\u043a\u0430 \u0437\u0432\u0443\u043a\u0430 \u0432\u0441\u0442\u0430\u043b\u0430 \u043a\u0430\u043a \u0440\u043e\u0434\u043d\u0430\u044f:) &nbsp; &nbsp;\u043e\u043a. \u043e\u0442\u0434\u0430\u044e \u0443\u0440\u043e\u043a \u0433\u0440\u0430\u0444\u0438\u043a\u0430\u043c<div><br><\/div>\r\n<br\/>\u0410\u043b\u0438\u0441\u0435\u0435\u0432\u0430 \u041e\u043b\u044c\u0433\u0430 (\u043f\u043e\u043c\u043e\u0449\u043d\u0438\u043a \u043a\u0443\u0440\u0430\u0442\u043e\u0440\u0430):\r\n<br\/><span style=\"font-family: Helvetica, Arial, sans-serif; font-weight: bold; line-height: 14.039999961853027px;\">\u0413\u0420\u0410\u0424\u0418\u041a\u0410\u041c: &nbsp;4. \u0441\u0434\u0435\u043b\u0430\u0442\u044c \u0441\u043b\u0430\u0439\u0434 \u0441 \u043f\u043e\u0434\u0440\u043e\u0431\u043d\u044b\u043c \u0447\u0435\u0440\u0442\u0435\u0436\u043e\u043c \u0442\u043e\u0447\u0435\u043a &nbsp; \u043d\u0430 \u043c\u043e\u043c\u0435\u043d\u0442 30:14 \u2013 31:12 &nbsp; &nbsp;\u0417\u0434\u0435\u0441\u044c \u0442\u0430\u043a\u0436\u0435 \u043c\u043e\u0436\u043d\u043e \u0432\u043c\u0435\u0441\u0442\u043e \u043a\u0430\u0434\u0440\u043e\u0432 \u0443\u0447\u0438\u0442\u0435\u043b\u044f \u0432\u043c\u043e\u043d\u0442\u0438\u0440\u043e\u0432\u0430\u0442\u044c \u043f\u043b\u0430\u043d \u0441 \u043f\u043b\u0430\u043d\u0448\u0435\u0442\u0430 \u0438 \u0441\u0434\u0435\u043b\u0430\u0442\u044c \u0433\u0440\u0430\u0444\u0438\u043a\u0443 \u043d\u0430 \u0444\u043e\u043d\u0435 \u0434\u043e\u0441\u043a\u0438 \u0430 \u043f\u043e\u0442\u043e\u043c \u043a\u043e\u0433\u0434\u0430 \u0443\u0436\u0435 \u043f\u043e\u0439\u0434\u0435\u0442 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0435\u0435 \u0443\u0431\u0440\u0430\u0442\u044c &nbsp;(\u0435\u0441\u043b\u0438 \u0438\u0437\u0437\u0430 \u0440\u0443\u043a \u043d\u0435 \u043f\u043e\u043b\u0443\u0447\u0438\u0442\u0441\u044f \u0442\u043e \u043f\u0440\u043e\u0441\u0442\u043e \u0441\u043b\u0430\u0439\u0434 \u043a \u044d\u0442\u043e\u043c\u0443 \u043c\u0435\u0441\u0442\u0443 &nbsp; &nbsp; &nbsp;5. &nbsp;\u0441\u0434\u0435\u043b\u0430\u0442\u044c \u0433\u0440\u0430\u0444\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u0432\u0441\u0442\u0430\u0432\u043a\u0435 \u043d\u0430 \u0444\u043e\u043d\u0435 \u0434\u043e\u0441\u043a\u0438 \u043d\u0430 \u0441\u0432\u043e\u0431\u043e\u0434\u043d\u043e\u0435 \u043c\u0435\u0441\u0442\u043e \u0441\u043b\u0435\u0432\u0430 \u0432 \u0434\u0432\u0443\u0445 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0445 \u0437\u0430\u0434\u0430\u0447\u0430\u0445 \u0441 39:05<\/span>\r\n<br\/>\u0410\u043b\u0438\u0441\u0435\u0435\u0432\u0430 \u041e\u043b\u044c\u0433\u0430 (\u043f\u043e\u043c\u043e\u0449\u043d\u0438\u043a \u043a\u0443\u0440\u0430\u0442\u043e\u0440\u0430):\r\n<br\/>\u0413\u0440\u0430\u0444\u0438\u043a\u0430\u043c \u043f\u043e\u043a\u0430 \u0432 \u0440\u0430\u0431\u043e\u0442\u0443 \u043d\u0435 \u0431\u0440\u0430\u0442\u044c !!! \u0434\u043e\u0441\u043d\u044f\u0442\u044b \u0435\u0449\u0435 \u043e\u0442\u0432\u0435\u0442\u0432\u043b\u0435\u043d\u0438\u044f \u043e\u0442\u0434\u0430\u044e \u043d\u0430 \u0434\u043e\u043c\u043e\u043d\u0442\u0430\u0436. &nbsp; &nbsp;\u043f\u043e\u0441\u043b\u0435 \u044d\u0442\u043e\u0433\u043e \u043d\u0430\u0434\u043e \u0431\u0443\u0434\u0435\u0442 \u0441\u0434\u0435\u043b\u0430\u0442\u044c \u043f\u0440\u0435\u0434\u044b\u0434\u0443\u0449\u0438\u0439 \u043a\u043e\u043c\u0435\u043d\u0442 \u043f\u043b\u044e\u0441 \u043f\u0435\u0440\u0435\u043a\u0440\u044b\u0442\u0438\u0435 \u0434\u043e\u043f \u043e\u0442\u0432\u0435\u0442\u0432\u043b\u0435\u043d\u0438\u0439\r\n<br\/>\u041a\u0440\u0430\u0441\u0438\u043b\u044c\u043d\u0438\u043a\u043e\u0432 \u0412\u043b\u0430\u0434\u0438\u0441\u043b\u0430\u0432 (\u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u043e\u0442\u0434\u0435\u043b\u0430 \u043c\u043e\u043d\u0442\u0430\u0436\u0430):\r\n<br\/><strong>\u0418\u0441\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u044b\u0439 \u0432\u0430\u0440\u0438\u0430\u043d\u0442 \u0431\u0435\u0437 \u0433\u0440\u0430\u0444\u0438\u043a\u0438 tarasov_26052014_uravnenie_okruzjnosti_ver3__1.flv<\/strong>\r\n<br\/>\u0410\u043b\u0438\u0441\u0435\u0435\u0432\u0430 \u041e\u043b\u044c\u0433\u0430 (\u043f\u043e\u043c\u043e\u0449\u043d\u0438\u043a \u043a\u0443\u0440\u0430\u0442\u043e\u0440\u0430):\r\n<br\/>\u043e\u0442\u0434\u0430\u044e \u0432 \u0440\u0430\u0431\u043e\u0442\u0443 \u041e\u0414 \u043f\u0435\u0440\u0435\u043a\u0440\u044b\u0442\u044c \u043e\u0442\u0432\u0435\u0442\u0432\u043b\u0435\u043d\u0438\u044f \u043f\u043e\u043b\u043d\u043e\u0446\u0435\u043d\u043d\u043e\u0439 \u0433\u0440\u0430\u0444\u0438\u043a\u043e\u0439 \u0438 \u0441\u043c\u043e\u0442\u0440\u0438\u043c \u043c\u043e\u0439 \u043f\u0440\u0435\u0434\u044b\u0434\u0443\u0449\u0438\u0439 \u043a\u043e\u043c\u043c\u0435\u043d\u0442 \u0434\u043b\u044f \u0433\u0440\